INSERT INTO `BS_SYS_NOTICE` VALUES ('2', '&nbsp;&nbsp;&nbsp;&nbsp;4月29日上午，数码易知公司召开“两学一做”学习教育动员会，传达交通运输部及社党组关于“两学一做”学习教育活动的要求，部署公司“两学一做”学习教育工作。会议由公司总经理、党总支书记李洪林主持，公司各事业部管理人员、各党支部书记及委员等参加了会议。<br>&nbsp;&nbsp;&nbsp;&nbsp;会上，李洪林总经理传达了4月7日交通运输部杨传堂部长在“两学一做”学习教育动员部署视频会上的讲话精神和社党组关于“两学一做”学习教育工作方案。李颖副总经理介绍了公司党总支开展“两学一做”学习教育的工作计划安排，并对学习措施进行了详细说明。党总支委员何慧君还介绍了公司党建和精神文明建设的重点工作。', null, null, null, null, null, '2016-09-06', null, '1', '测试', '2016-09-30');
